import { createRouteBundle } from 'redux-bundler';
import Home from '../containers/home';
import Map from '../containers/map/map-page';
import FourOhFour from '../containers/404';

export default createRouteBundle({
  '/': Home,
  '/map': Map,
  '*': FourOhFour
})
